import React from "react";
import { QuestionData } from "./questionsData";
import { Question } from "./Question";

interface Props {
    data: QuestionData[];
}

export const QuestionList = ({ data }: Props) => (
    <ul>
        (
        {data.map((question) => (
            <li key={question.Id}>
                <Question data={question} />
            </li>
        ))}
        )
    </ul>
);
